package wallet

import (
	"encoding/json"
	"net/http"
)

type DiscoveryService struct {
	FType string `json:"f_type"`
	FVsn string `json:"f_vsn"`
	Type string `json:"type"`
	Endpoint string `json:"endpoint"`
	Method string `json:"method"`
	Uid string `json:"uid"`
	Provider DiscoveryServiceProvider `json:"provider"`
}

type DiscoveryServiceProvider struct {
	Address string `json:"address"`
	Name string `json:"name"`
	Icon string `json:"icon"`
	Description string `json:"description"`
	Color string `json:"color"`
	Website string `json:"website"`
}

func (server *server) discoveryHandler(w http.ResponseWriter, r *http.Request) {
	services := []DiscoveryService{
		{
			FType: "Service",
			FVsn: "1.0.0",
			Type: "authn",
			Endpoint: getBaseUrl(r) + "/api/authn",
			Method: "HTTP/POST",
			Uid: "devwallet#authn",
			Provider: DiscoveryServiceProvider{
				Address: "0xDevWallet",
				Name: "Dev Wallet",
				Icon: "data:image/png;base64,",
				Description: "Make sure you have Dev Wallet running on Port 8702, unless override specified.",
				Color: "#00ec82d9",
				Website: "https://github.com/onflow/fcl-dev-wallet",
			},
		},
	}

	obj, err := json.Marshal(services)
	if err != nil {
		w.WriteHeader(http.StatusInternalServerError)
		return
	}

	w.WriteHeader(http.StatusOK)
	w.Header().Set("Content-Type", "application/json")
	w.Write(obj)
}